text:
climate change is here. since 1980, the amount of forest fires in the american west have increased four-fold while the fire season has increased by 2.5 months. and this is just the beginning. anthropogenic climate change is not some distant problem that we can leave to future generations to solve. and it is 100% human caused. (here come the teenage boys who think they know more about climate science than thousands of academics...🙄) concerted and vital actions must be taken today to prevent temperatures being 4-7 degrees celsius above pre-industrial times by the end of the century. and let me remind you that’s just a global average. temperatures are already 1.1 degrees celsius above pre-industrial times but places like the arctic are now 7 degrees above average today!!! if you want to know more about ocean acidification, feedback loops, tropical cyclone intensification, the death of all coral reefs by 2050, implications for global security and increased conflict, why there was a “global warming hiatus”...i will be writing a book on it all in the next year as i finish my thesis on the pacific decadal oscillation. in the meantime, ask any questions you might have in comments and i’ll try and answer. anyone know of a good publisher?! 😃🌎✊❤️
*
*
*
@climatebriefings 
@striveforpositivechange 
@fuckthecynics

